// Importando o React
import React, {Component} from "react";
// Importando os components necessários da lib react-materialize
import { Row, Table} from 'react-materialize';
import axios from 'axios'

const API_URL = 'https://api-fullstackgo.herokuapp.com/api';

class Tbl  extends Component {
     state = {
      details: []
    }
    componentDidMount() {
      const url = '${API_URL}/details/';
      axios.get(url).then(response => response.data)
      .then((data) => {
        this.setState({ details: data })
        console.log(this.state.detausersils)
       })
    }

  render () {

    return (
      <Row>
        <Table className="highlight centered">
            <thead>
              <tr>
                  <th>Data</th>
                  <th>Valor</th>
                  <th>Excluir</th>
              </tr>
            </thead>
            <tbody>
              {this.state.details.map((user) => (
                <tr>
                  <td><span>{user.type}</span></td>
                  <td><span></span></td>
                  <td><a href="/">X</a></td>
                </tr>
              ))}
            </tbody>
        </Table>
      </Row>
    );
  }

}

export default Tbl;
